import React from "react";
import { Link } from "react-router-dom";
import "../styles/navbar.css";
import logo from "../assets/cblu_logo.png";
// Example: You can use a free animated GIF from the web or your own asset
import sparkleGif from "../assets/sparkle.gif"; // Place a small gif in your assets folder

const Navbar = () => (
  <nav className="navbar">
    <div className="navbar-logo">
      <Link to="/">
        <img
          src={logo}
          alt="Logo"
        />
        <span className="hostel-app-title">
          CBLU Hostel Explorer
          <img
            src={sparkleGif}
            alt="sparkle"
            style={{
              height: "28px",
              width: "28px",
              marginLeft: "8px",
              verticalAlign: "middle"
            }}
          />
        </span>
      </Link>
    </div>
    <ul className="navbar-links">
      <li>
        <Link to="/">Home</Link>
      </li>
      <li>
        <Link to="/list-pg">Add PG</Link>
      </li>
      <li>
        <Link to="/contact">Contact</Link>
      </li>
    </ul>
  </nav>
);

export default Navbar;
